import { axios } from "./network";

const getDishes = ( ) =>
new Promise((resolve, reject) => {
  axios({
    method: 'GET',
    url: `/allDish`
  })
    .then(({ data }) => {
      resolve(data);
    })
    .catch(error => {
      reject(error.response ? error.response.data : {});
    });
});

export { getDishes };
